import React, { Component } from "react";
import { connect } from "react-redux";
import { withRouter } from "react-router-dom";
import { getSearchAll } from "../../../Actions";
class SearchPage extends Component {
  render() {
    return (
      <div>
        <h4 className="genres-heading">
          Search Result for {this.props.match.params.key}
        </h4>
        <div className="row align-items-end">
          {/* <span className="col-6 font-weight-bold">Search Result</span> */}
          <div className="col-12">
            <hr />
          </div>
        </div>
        <div className="section"></div>
      </div>
    );
  }
}
const MapStateToProps = (state) => ({
  searchArray: state.home.searchData,
});

export default withRouter(
  connect(MapStateToProps, { getSearchAll })(SearchPage)
);
